function autocomplete_select(event, ui, url) {
  ajax_request(url, ui.item.label, 'label', null);
}

function clear_after_select(input_id) {
  document.getElementById(input_id).value = '';
}

function add_auto_complete(input_id, ajax_uri, data_source_uri) {
  $(function() {
    $("#" + input_id).autocomplete(
      {source: data_source_uri},
      {select: function(event, ui) { autocomplete_select(event, ui, ajax_uri); clear_after_select(input_id); return false; }}
    );
  });
}

function add_auto_complete_redirect(input_id, uri, data_source_uri) {
  $(function() {
    $("#" + input_id).autocomplete(
      {source: data_source_uri},
      {select: function(event, ui) {
	    full_uri = uri + "?label=" + encodeURIComponent(ui.item.label);
	    //alert(full_uri);
	    location.href = uri + "?label=" + encodeURIComponent(ui.item.label);
	    return false;
	  }}
    );
  });
}

function add_auto_complete_same_page_with_id(input_id, data_source_uri, id_property_name) {
  $(function() {
    $("#" + input_id).autocomplete(
      {source: data_source_uri},
      {select: function(event, ui) {
	    full_uri = location.href;
	    old_add_person_id_index = full_uri.indexOf("&" + id_property_name);
	    if(old_add_person_id_index != -1) {
		  full_uri = full_uri.substring(0, old_add_person_id_index);
		}
	    full_uri = full_uri + "&" + id_property_name + "=" + encodeURIComponent(ui.item.id);
	    location.href = full_uri;
	    return false;
	  }}
    );
  });
}

